# -*- coding: utf-8 -*-

from reportlab.graphics.barcode import common
from reportlab.lib.units import mm
from reportlab.lib.utils import ImageReader
from reportlab.lib.pagesizes import A4
from reportlab.pdfgen import canvas
from reportlab.pdfbase import pdfmetrics
from reportlab.pdfbase.ttfonts import TTFont
from reportlab.platypus import Paragraph
from reportlab.lib.styles import getSampleStyleSheet, TA_LEFT, TA_CENTER
import os
import tempfile
from base64 import standard_b64decode
from io import BytesIO

def render_notifications(letter_iterator):
    """ Создает pdf файл во временной папке со страницами в виде уведомлений ф119 для двусторонней печати

    :param letter_iterator: итератор, возвращающий кортеж (letter_info,
    from_info)
    :return: путь к файлу pdf
    """
    # грязно, но обычно этот шрифт есть
    pdfmetrics.registerFont(TTFont('TimesNewRoman', 'times.ttf'))
    #
    hndl, path = tempfile.mkstemp(suffix='.pdf')
    #закрываем хэндл, иначе получим ошибку при открытии pdf файла
    tmp = os.fdopen(hndl, 'w')
    tmp.close()
    # do draw
    c = canvas.Canvas(path, pagesize=A4)
    llist = []
    flist = []
    for letter_info, from_info  in letter_iterator:
        llist.append(letter_info)
        flist.append(from_info)
        if len(llist)==4:
            render_notif(c, llist, flist)
            llist = []
            flist = []
    if len(llist)>0:
        render_notif(c, llist, flist)
    c.save()
    return path

def render_notif(canv, letter_list, from_info_list):
    """ Выводит две страницы ф119. Предполагается, что len(letter_list)==len(from_info_list) <=4

    """
    TRANS_DICT = [
        {"front_rotate":90, "front_x":0*mm, "front_y":-100*mm,
         "back_rotate":-90, "back_x":-145*mm, "back_y":110*mm}, #0
         
        {"front_rotate":90, "front_x":153*mm, "front_y":-100*mm,
         "back_rotate":-90, "back_x":-297*mm, "back_y":110*mm}, #1
         
        {"front_rotate":90, "front_x":0*mm, "front_y":-210*mm,
        "back_rotate":-90, "back_x":-145*mm, "back_y":0*mm}, #2
         
        {"front_rotate":90, "front_x":153*mm, "front_y":-210*mm,
         "back_rotate":-90, "back_x":-297*mm, "back_y":0*mm}, #3
    ]
    for i in range(len(letter_list)):
        from_info = from_info_list[i]
        canv.saveState()
        canv.rotate(TRANS_DICT[i]["front_rotate"])
        canv.translate(TRANS_DICT[i]["front_x"], TRANS_DICT[i]["front_y"])
        canv.drawImage(ImageReader(BytesIO(
            standard_b64decode(BG1))), 0*mm, 0*mm, 145*mm, 100*mm)
        TEXT = [
            {"x":73,"y":56,"w":60,"h":10, "fontsize":10,"font":"TimesNewRoman","alignment":TA_LEFT,"text": from_info["name"]},
            {"x":73,"y":38,"w":60,"h":10, "fontsize":10,"font":"TimesNewRoman","alignment":TA_LEFT,"text": from_info["addr"]},
        ]
        for j in TEXT:
            ps = getSampleStyleSheet()["Normal"]
            ps.fontName = j["font"]
            ps.alignment = j["alignment"]
            ps.fontSize = j["fontsize"]
            P = Paragraph(j["text"], ps)
            w,h = P.wrap(j["w"]*mm, j["h"]*mm)
            P.drawOn(canv,j["x"]*mm, j["y"]*mm)
        ps = getSampleStyleSheet()["Normal"]
        ps.fontName = "TimesNewRoman"
        ps.alignment = TA_CENTER
        ps.fontSize = 10
        for j in range(6):
            P = Paragraph(from_info["index"][j], ps)
            w,h = P.wrap(5*mm, 5*mm)
            P.drawOn(canv,(60+j*4.7)*mm, 25*mm)
        canv.restoreState()
    canv.showPage()
    for i in range(len(letter_list)):
        letter_info = letter_list[i]
        dst_name = letter_info["recipient-name"]
        dst_addr = ", ".join(map(lambda k: letter_info[k],
            filter(lambda a: a in letter_info,["region-to", "area-to", "place-to", "location-to", "street-to", "hotel-to", "house-to", "slash-to", "letter-to", "building-to", "corpus-to", "room-to"])
        ))
        dst_index = "%06d" % letter_info["index-to"]
        TEXT = [
            {"x":25,"y":74,"w":105,"h":15, "fontsize":10,"font":"TimesNewRoman","alignment":TA_LEFT,"text": dst_name+", "+dst_addr},
        ]
        canv.saveState()
        canv.rotate(TRANS_DICT[i]["back_rotate"])
        canv.translate(TRANS_DICT[i]["back_x"], TRANS_DICT[i]["back_y"])
        canv.drawImage(ImageReader(BytesIO(
            standard_b64decode(BG2))), 0*mm, 0*mm, 145*mm, 100*mm)
        for j in TEXT:
            ps = getSampleStyleSheet()["Normal"]
            ps.fontName = j["font"]
            ps.alignment = j["alignment"]
            ps.fontSize = j["fontsize"]
            P = Paragraph(j["text"], ps)
            w,h = P.wrap(j["w"]*mm, j["h"]*mm)
            P.drawOn(canv,j["x"]*mm, j["y"]*mm-h)
        ps = getSampleStyleSheet()["Normal"]
        ps.fontName = "TimesNewRoman"
        ps.alignment = TA_CENTER
        ps.fontSize = 10
        for j in range(6):
            P = Paragraph(dst_index[j], ps)
            w,h = P.wrap(5*mm, 5*mm)
            P.drawOn(canv,(103+j*4.7)*mm, 58*mm)
        canv.restoreState()
    canv.showPage()

